import React, { Component } from "react";
import User from "./user";

class Users extends Component {
  render() {
    return (
      <div>
        <h1>{this.props.title}</h1>
        <User age="30">Mark</User>
        <User></User>
        <User age="40">Tom</User>
      </div>
    );
  }
}

export default Users;
